import React from "react";
const About = () => (
<section id="about" className="p-10 bg-gray-100 text-gray-900 min-h-screen">
<h2 className="text-4xl font-bold mb-6">About Me</h2>
<p className="text-lg max-w-3xl mb-4">
I'm a web developer with experience in React, Node.js, and modern web technologies. I love building interactive applications and exploring new tech.
</p>
<p className="text-lg max-w-3xl">
Skills: JavaScript, React, TailwindCSS, Node.js, Python, Git, Responsive Design
</p>
</section>
);
export default About;
